import json
from sys import stdin

def manhattan_dist(a,b,x,y):
    return abs(x-a) + abs(y-b)

def transform_mat(dist, matrix, x, y):
    for i in range(len(matrix)):
        for j in range(len(matrix[0])):
            if manhattan_dist(i,j,x,y) <= dist:
                matrix[i][j] = (matrix[i][j] + 1)%2

    return matrix

def check_answer(input, output):
    input_mat = []
    input = input.strip().split('\n')
    mat_size, dist = map(int, input[0].strip().split(' '))
    for i in range(mat_size):
        input_mat.append(map(int, input[i+1].strip().split(' ')))

    output = output.strip().split('\n')

    if output[0].strip() == "Impossible":
        return False

    if not output[1].isdigit():
        return False

    transforms = int(output[1])
    if len(output) != transforms + 2:
        return False

    if transforms > mat_size**2:
        return False

    for i in range(transforms):
        try:
            a,b = map(int, output[i+2].strip().split(' '))
        except:
            return False
        input_mat = transform_mat(dist, input_mat, a, b)
        # now do the transforms here

    for i in range(len(input_mat)):
        for j in range(len(input_mat[0])):
            if input_mat[i][j] != 0:
                return False

    return True

def check_inputs (exp_outputs, outputs, inputs, signals ):
    scores = []
    valid = []
    for tid in range(len(inputs)):
        input = inputs[tid].strip()
        output = outputs[tid].strip()
        exp_output = exp_outputs[tid].strip()

        if signals[tid] != 0:
            scores.append(0)
            valid.append(0)
        else:
            try:
                if ((output.split()[0] == "Impossible" and exp_output.split()[0] == "Impossible") or check_answer(input, output)):
                    valid.append(1)
                    scores.append(1.0)
                else:
                    valid.append(0)
                    scores.append(0)
            except:
                valid.append(0)
                scores.append(0)

    return scores, valid

if __name__ ==  '__main__':
    stdin = stdin.read().split('\n')

    # Get the run directory for the submission we need to evaluate. I know,
    # hackish right?

    run_directory = stdin[0]

    # request.json contains the data submitted for the current.
    request = json.load(open(run_directory + "request.json"))

    data = {
        # The submitted source code
        "outputs": [],
        "inputs": [],
        "expected_outputs": request["expected_outputs"],
        "signals":[]
    }

    data["signals"] = map( int, open( "signal00.sig" ).read().strip().split() )
    for index in range(len(request["testcase_sources"])):
        output = open(run_directory + "output%05d.out" %(index)).read()
        input = open(run_directory + "input%05d.in" %(index)).read()
        data["outputs"].append(output)
        data["inputs"].append(input)

    # Gathered all the data we could, lets process it
    score, testcase_status = check_inputs(data["expected_outputs"], data["outputs"], data["inputs"], data["signals"])

    print sum(score)/len(score)
    print " ".join(str(i) for i in testcase_status)
